import React from "react";
import "./Acceuil.css";
import index from './index'

class Acceuil extends React.Component {

        
    state = {
        item : [
        {title: "cours1"},
        {title: "cours2"},
        {title: "cours3"},
        {title: "cours4"},
        {title: "cours5"},
        {title: "cours6"}
    ]}

  render(props) {

        const bac = this.state.item.map( (it) => {
            return(
                <li>
                <a href="#">{it.title}</a>
              </li>

            );
        }
        )

    return (
      <div>
        <div class="list-type5 mt-5">
          <ol>
            {bac}
            {this.props.key}
          </ol>
        </div>
      </div>
    );
  }
}

export default Acceuil;
